import React from "react";
import PropTypes from 'prop-types'

export const Tile = ({ tile }) => {
  return (
    <div className="tile-container">
      {Object.values(tile).map((value, index) =>
      <p key={index} className={`${index === 0 ? 'tile-title': ''} tile`}> {value}
      </p>       
      )}      
    </div>
  );
};

Tile.propTypes = {
  tile: PropTypes
}
